import "./Navbar.scss";

const Navbar = () => {
  return (
    <div className="navbar">
      <a href="#aboutus">About Us</a>
      <a href="#aboutus">For You</a>
      <a href="#aboutus">Services</a>
      <a href="#aboutus">Blog</a>
      <a href="#aboutus">Vlog</a>
    </div>
  );
};
export default Navbar;
